// import "//dapi.kakao.com/v2/maps/sdk.js?autoload=false&appkey=915cffed372954b7b44804ed422b9cf0&libraries=services,clusterer&autoload=false";

export const getAddressCoordinates = async (kakao, addr) => {
    const geocoder = new kakao.maps.services.Geocoder();

    console.log("여기까진 멀쩡해!");
    const result = await geocoder.addressSearch(addr, (res, stat) => {
        if (stat === kakao.maps.service.Status.OK) {
            console.log("나와라 좌표!");
            return new kakao.maps.LatLng(res[0].x, res[0].y);
        } else {
            alert(
                "ERROR: UNKNOWN EXCEPTION.\n"+
                "to [services.Geocoder]\n"+
                "from '/api/geocoder.js'"
            );
            return null;
        }
    });
    return result;
}

const geocoder = new kakao.maps.services.Geocoder();

await geocoder.addressSearch(data.roadAddress || data.jibunAddress, (res, stat) => {
    if (stat === kakao.maps.services.Status.OK) {
        console.log("나와라 좌표!");
        const result = new kakao.maps.LatLng(res[0].x, res[0].y);
        console.log(result);
        return result;
    } else {
        console.log("으아악!");
        alert(
            "ERROR: UNKNOWN EXCEPTION.\n"+
            "to [services.Geocoder]\n"+
            "from '/api/geocoder.js'"
        );
        return null;
    }
});
